import React from "react";

const NotFoundPage = () => {
  return (
    <div className="route-container">
      <div className="route-container-items" style={{
        fontSize:"30px",
        padding: "100px"
      }}>
        404 Not Found
      </div>
    </div>
  );
};

export default NotFoundPage;
